import React, { useContext } from 'react'
import { NameContext } from '../Context/NameContext'

const UpdateProfil = () => {
    const name = useContext(NameContext)
    console.log(name);

    return (
        <div>
            <h1> Profil de {name.map((name) => (
                <p> [{name}] {name.pseudo} </p>
            ))} </h1>
        </div>
    )
}

export default UpdateProfil
